import './App.css';
import NavBar from '../components/NavBar'
import AppRouter from './AppRouter'
function App() {
  return (
    <Router>
        <div className="App">
            <NavBar/>
        </div>

        <Routes>
          <Route path="/" exact component={FrontPage}/>
          <Route path="/about" exact component={AboutPage}/>
        </Routes>

    </Router>
  );
}

export default App;
